import React from 'react';

function ClienteDetalhes({ cliente }) {
  return (
    <div>
      <h2>{cliente.nome}</h2>
      <p>Nome: {cliente.nome}</p>
      <p>Número: {cliente.numero}</p>
      <p>Técnico: {cliente.tecnico}</p>
      <p>Modelo do Veículo: {cliente.modeloVeiculo}</p>
      <p>Disjuntor de Entrada: {cliente.disjuntorEntrada}</p>
      <p>Cabo de Entrada: {cliente.caboEntrada}</p>
    </div>
  );
}

export default ClienteDetalhes;
